import React, { useState } from 'react';
import './App.css';
import { Button } from 'antd';

const App: React.FC = () => {
  const [session, setSession] = useState([
    { title: 'Warm-UP', time: 10 },
    { title: 'Common Sentences', time: 10 },
    { title: 'Listening', time: 10 },
    { title: 'Speaking', time: 10 },
    { title: 'Discussion', time: 10 },
    { title: 'Fixing Issues', time: 10 },
  ]);

  const sessionList = (
    <div className="session-container">
      {session.map((s) => (
        <div>
          ${s.time}: ${s.time}mins
        </div>
      ))}
    </div>
  );

  return (
    <div className="App">
      <h1>Class Timer</h1>
      <hr />
      <div></div>
      <Button type="primary">Button</Button>
    </div>
  );
};

export default App;
